import style from './index.module.css'

const Menu = ({ children }) => {
    return (
        <ul style={{
            paddingLeft: 0
        }}>{children}</ul>
    )
}

const Item = ({ children }) => {
    return (
        <li className={style.item}>{children}</li>
    )
}

Menu.Item = Item

export default Menu
